import { useState } from "react";

function NewArticle(props) {
    const [name, setName] = useState("");
    const [price, setPrice] = useState(0);
    const [type, setType] = useState("");
    const [brand, setBrand] = useState("");

    const addItemButtonPressed = () => {
        props.addItem({name : name, price : price, type : type, brand : brand});
        setName("");
        setPrice(0);
        setType("");
        setBrand("");
    }

    return (
        <div className="container">
            <div className="row">
                <h2>Nový článek</h2>
            </div>
            <div className="row">
                <label htmlFor="name-filed">Název: </label>
                <input className="form-control" id="name-filed" type="text" value={name} onChange={(e) => setName(e.target.value)}></input>
                <label htmlFor="price-filed">Price: </label>
                <input className="form-control" id="price-filed" type="number" value={price} onChange={(e) => setPrice(e.target.value)}></input>
                <label htmlFor="type-filed">Type: </label>
                <input className="form-control" id="type-filed" type="text" value={type} onChange={(e) => setType(e.target.value)}></input>
                <label htmlFor="brand-filed">Brand: </label>
                <input className="form-control" id="brand-filed" type="text" value={brand} onChange={(e) => setBrand(e.target.value)}></input>
            </div>
            <div className="row mt-3">
                <button className="btn btn-secondary" type="button" onClick={addItemButtonPressed}>Add Item</button>
            </div>
        </div>

    )
}
export default NewArticle;
